import React from 'react'
import './Product.css'
import items from '../Data'
const Product = () => {
  return (
    <>
     <div className="cantainer">
      <dir className='row'>
      {items.map((item,i)=>{

        return (
          <>
          <div className="card" key={i} id={item.id} title={item.title} description={item.description} imgSrc={item.imgSrc} price={item.price}>
            <img src={item.imgSrc} alt="" />
            <h5>{item.title}</h5>
            <p>{item.description}</p>
            <p className="price">$ {item.price}</p>
          </div>
          </>
        )
      })}
      </dir>
      </div> 
    </>
  )
}

export default Product
